        <View style={{paddingTop: 50}}>
            <Button
                onPress={signOut(onChangeSingOut)}
                title="Sing Out of the chat"
                color="#ff9900"
            />
            {/* <View>
                <Components_Chat path="/screens/Components_Login.tsx" />
            </View> */}
        </View>
    );
}

async function signOut(onChangeSingOut : any) {
    try {
       Auth.signOut({ global: true });
       onChangeSingOut(true)
    } catch (error) {
        console.log('error signing out: ', error);
    }
}


